import React, {useState}from 'react';
import styled from 'styled-components';



const Navbar = () => {

    const [showDiv, setShowDiv] = useState(false);

    const handleHover = () => {
    setShowDiv(true);
  };

  const handleLeave = () => {
    setShowDiv(false);
  };

    const d = new Date();
    const year = d.getFullYear();


    return (
        <Container>
        <Promotions>
            <a href='https://www.mcgeeandco.com/pages/the-outdoor-collection' >
                SHOP MCGEE & CO. {year} OUTDOOR COLLECTION
            </a>
        </Promotions>
        <Hr />  
        <Nav>
        <Logo > <Img src="https://studio-mcgee.com/app/themes/studio-mcgee/dist/images/logo_b53b4862.svg" alt=""/>      
        </Logo>  
        <Navmenu>
        <NavLink onMouseOver={handleHover} onMouseLeave={handleLeave} to = "/"><span>Home</span></NavLink>
        <NavLink onMouseOver={handleHover} onMouseLeave={handleLeave} to = "/products"><span>Products</span></NavLink>
        <NavLink onMouseOver={handleHover} onMouseLeave={handleLeave} to = "/contact"><span>Contact</span></NavLink>
        <NavLink onMouseOver={handleHover} onMouseLeave={handleLeave}  to = "/about"><span>About</span></NavLink>

        <div className='logoHamburger'>
        <SearchLogo>
        <Img src="https://studio-mcgee.com/app/themes/studio-mcgee/dist/images/icon-search_1be8cefa.svg" alt=""/>
        </SearchLogo>

        <div className='hamburger'>
            <span></span>
            <span></span>
            <span></span>
        </div>

        </div>

        </Navmenu>  

         
        </Nav>

        <Hr />  
        
        </Container>
        
    )
}

const Container = styled.div`
display:flex;
flex-direction: column;
justify-content:center;
align-items: center;
margin-top: 0;
background-color:  #f8f7f3;

.relativePosition {
    position: relative;
    top: 0;
    left: 0;
    width: 100%;
    z-index: 1000;
}

`

const Promotions = styled.div`
display:flex;
flex-direction: column;
justify-content:center;
align-items:center;
width: 100%;
height:34px;



a{
    text-decoration: none;
    color: #474747;
    font-family: forma-djr-text,sans-serif;
    font-size: 10px;
    font-weight: 400;
    line-height: 16px;
    font-style: normal;
    letter-spacing: 1.94px;

    &:hover{
        cursor: pointer;
        opacity: 0.8;
    }
}
`


const Hr = styled.hr`
width: 100%;
height: 0.5px;
background-color: #000000;
margin:0;`


const Nav = styled.nav`
display:flex;
flex-direction:row;
justify-content: space-between;
width:100%;
height: 56px;
background-color: #ffffff;
padding-left: 30px;`


const Logo = styled.div`
display:flex;
justify-content:center;
align-items:center;
color:#3f3f3f;
`

const Img = styled.img`
cursor:pointer;

&:hover {
    opacity:0.8;
}`


const Navmenu = styled.div`
display:flex;
flex-direction:row;
justify-content:space-between;
align-items:center;
min-width:700px;
width:30%;
white-space:nowrap;
max-width:100vw;
cursor:pointer;

.hamburger {
    display: none;
    cursor: pointer;

    span {
        display: block;
        width: 20px;
        height: 1px;
        margin-bottom: 5px;
        background-color: #3f3f3f;
      
      &:last-child {
        margin-bottom: 0;
    }}
    @media (max-width: 992px) {
    Navmenu {
        width:100vw;
    }
    display:block;
}  
}

.logoHamburger {
    display:flex;
    flex-direction:row;
    justify-content:center;
    align-items:center;
    color:#3f3f3f;
    font-family: forma-djr-text,sans-serif;
    font-size: 10px;
    font-weight: 400;
    line-height: 16px;
    font-style: normal;
    letter-spacing: 1.94px;
    @media (max-width: 992px) {
        position:absolute;
        right: 30px;

    }
  
}`

const NavLink = styled.a` 

    position:relative;
    text-decoration:none;
    color: #474747;
    font-family: forma-djr-text,serif;
    font-variant: full-width;
    font-size:15px;
    padding: 5px;
    white-spacing:no-wrap;
    font-weight:300;
    font-style:normal;
    line-height: 16px;


    span {
    display: inline-block;
    position: relative;
  }

    span::before {
    content: "";
    position: absolute;
    width: 0;
    height: 3px;
    bottom: -20px;
    left: 0;
    background-color: #474747;
    transition: width 0.3s ease-in-out;
    }

    &:hover
    span::before {
    width: 100%;}
    
@media (max-width: 992px){
    display: none;
}
`

const SearchLogo = styled.div`
padding:20px;
margin-left: 8px;

@media (max-width: 992px){

    position: relative;
    right:0;
}`



export default Navbar;
